 import { Injectable } from '@angular/core';
import { toBase64String } from '@angular/compiler/src/output/source_map';

@Injectable({
  providedIn: 'root'
})
export class FileDownloaderService {

  constructor() { }
  public base64ToBlob(b64Data: string, contentType='', sliceSize=512) {
    b64Data = b64Data.replace(/\s/g, ''); //IE compatibility...
    let byteCharacters = atob(b64Data);
    let byteArrays = [];
    for (let offset = 0; offset < byteCharacters.length; offset += sliceSize) {
        let slice = byteCharacters.slice(offset, offset + sliceSize);

        let byteNumbers = new Array(slice.length);
        for (var i = 0; i < slice.length; i++) {
            byteNumbers[i] = slice.charCodeAt(i);
        }
        let byteArray = new Uint8Array(byteNumbers);
        byteArrays.push(byteArray);
    }
    return new Blob(byteArrays, {type: contentType});
}
GetDocumentImage(){
  return "data:image/png;base64,";
}
  downloadFile(b64encodedString: string|ArrayBuffer,filename:string) {
  
    if (b64encodedString) {
            var blob = this.base64ToBlob( b64encodedString.toString(), this.GetContentType(filename));
            var url = window.URL.createObjectURL(blob)  ;    
        const link = document.createElement('a');
        link.href = url;
        link.download = filename;
        link.click();
  
    }
  }
  OpenFile(b64encodedString: string|ArrayBuffer, filename:string){
   // console.log('Open Called');
    if (b64encodedString) {
      let CleanString = b64encodedString.toString();
      CleanString=CleanString.substring(CleanString.search(',')+1);
      //console.log(CleanString);
      var blob = this.base64ToBlob(CleanString, this.GetContentType(filename));
      var url = window.URL.createObjectURL(blob);

    window.open(url);
     window.navigator.msSaveOrOpenBlob(blob);
}
  }
  GetContentType(path:string)
  {
      var types = this.GetMimeTypes();
      var ext = path.substring(path.lastIndexOf('.'));
      ext=ext.toLocaleLowerCase(); 
      console.log("Types are:",types[ext]);
      return types[ext];
  }

  GetFileType (Datatype:string){
    var types= this.GetMimeTypes();
    let _showType : string;
    
    if (Datatype==types['.txt'] || Datatype==types['.pdf'] ||  Datatype.includes(types['.doc']) || Datatype.includes(types['.docx'])){
      _showType= 'Document';
    }
    else if (Datatype==types['.png'] || Datatype==types['.jpeg'] || Datatype==types['.gif']){
      _showType='Image';
    }
    else if (Datatype==types['.xls'] || Datatype==types['.xlsx'] || Datatype==types['.csv']){
      _showType='Spreadsheet';
    }
    else {
      _showType=Datatype;
    }
    return _showType;
  }
  
   GetMimeTypes()
  {
    var dict : {[key:string]: string}={};
    dict[".txt"]="text/plain";
    dict[".pdf"]="application/pdf";
    dict[".doc"]="application/vnd.ms-word";
    dict[".docx"]="application/vnd.openxmlformats-officedocument.wordprocessingml.document";
    dict[".xls"]="application/vnd.ms-excel";
    dict[".xlsx"]="application/vnd.openxmlformats-officedocument.spreadsheetml.sheet";
    dict[".png"]="image/png";
    dict[".jpg"]="image/jpeg";
    dict[".jpeg"]="image/jpeg";
    dict[".gif"]="image/gif";
    dict[".csv"]="text/csv";
    dict[".cs"]="text/plain" ;
                
      return dict;
  }
}
